import React, { useState } from 'react';
import TradingDashboard from './TradingDashboard';

const DISCOVER_TOKENS = [
  { name: '$PAWPAW', desc: 'Smart Whale + GambleFi', cap: '$1.2M', emoji: 'üê∂' },
  { name: 'BABY BOB', desc: 'Volume Spike + Meme', cap: '$0.8M', emoji: 'üê∏' },
  { name: 'RUGPULL', desc: 'High Risk + Meme', cap: '$0.1M', emoji: 'üí©' },
];

export default function DiscoverTab() {
  const [selected, setSelected] = useState(null);

  if (selected) {
    return <TradingDashboard initialToken={selected} />;
  }

  return (
    <div className="min-h-screen bg-gradient-to-b from-zinc-900 via-black to-zinc-900 px-6 py-10 text-white">
      <h2 className="text-3xl font-bold mb-8 text-center">Discover Tokens</h2>
      <div className="max-w-2xl mx-auto space-y-4">
        {DISCOVER_TOKENS.map(token => (
          <div
            key={token.name}
            className="flex items-center justify-between bg-black/40 rounded-xl p-6 border border-zinc-800 shadow hover:border-blue-500/20 cursor-pointer transition-all"
            onClick={() => setSelected(token)}
          >
            <div className="flex items-center gap-4">
              <span className="text-3xl">{token.emoji}</span>
              <div>
                <div className="text-xl font-bold text-white">{token.name}</div>
                <div className="text-sm text-zinc-400">{token.desc}</div>
              </div>
            </div>
            <div className="text-right">
              <div className="text-blue-300 font-bold text-lg">{token.cap}</div>
              <div className="text-xs text-zinc-500">Market Cap</div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}
